import React, { useEffect, useState } from "react";
import { APIHandler } from "config/C4";

const getAllRecipes = (callBack) => {
  const recipes = APIHandler.getAllRecipes();
  callBack(recipes);
};

const RecipesView = () => {
  const [allRecipes, setAllRecipes] = useState({});

  useEffect(() => {
    getAllRecipes(setAllRecipes);
  }, [setAllRecipes]);

  console.log(allRecipes);
  return (
    <div className="recipesView">
      <h1>Recipes View</h1>
      <button onClick={() => getAllRecipes()}>Get All Recipes</button>
    </div>
  );
};

export default RecipesView;
